import React,
      { Component } from 'react';

class Languages extends Component {

  processLanguages( arr_languages )
  {

    return arr_languages.map( ( language ) => {
      return (
        <li>
          <i></i>
          <p>{language.name}</p>
        </li>
      );
    });

  }

  render() {
    return (
        <div data-container-language>
          <div data-actual-language>
            <i></i>
            <p>Portugues</p>
          </div>
          <ul data-list-languages>
            {this.processLanguages()}
            {/*
              <li>
                <i></i>
                <p>Portugues</p>
              </li>
              <li>
                <i></i>
                <p>Ingles</p>
              </li>
              <li>
                <i></i>
                <p>Frances</p>
              </li>
              <li>
                <i></i>
                <p>Alemao</p>
              </li>*/}
          </ul>
        </div>
    );
  }
}
export default Languages;
